const Alert = (props) => {
  return <div style={{ height: "50px" }}>{props.alert &&
    <div className={`alert alert-${props.alert.type} alert-dismissible fadeshow`} role="alert"> {props.alert.msg} </div>}</div>;
};

export default Alert;
